import React from "react";
import SectionWithImg from "../Components/sectionWithImage";
import SmallNav from "../Components/smallNav";
import MainNav from "../Components/mainNav";

function Home() {
  return (
    <React.Fragment>
      <SmallNav />
      <MainNav />
      <SectionWithImg
        heading="Who We Are?"
        text={
          <div>
            <p>
              “Ideas and Technological discoveries are the driving engines of
              economy.”
            </p>{" "}
            OxYmora Technology Pvt. Ltd. is a leading MCA (Ministry Corporation
            of Affairs) approved, Electronics Product and service Provider
            Company. We create a better world full of richer digital experience
            through innovative technology and product. We are the patrons who
            enable our youth to bring innovative ideas and strategies for their
            digital transformation and automation. We are responsible for
            providing sales and marketing, trading, technical support and
            consumer services on electronic components and accessories. We are
            able to source material and components used in manufacturing of
            electronics including PCB Designing. From Engineering to application
            development, we help our clients to find the right problems to solve
            them effectively.
          </div>
        }
      />
    </React.Fragment>
  );
}

export default Home;
